INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24015, 24, 0.0, 0.0, "カオリ（サマー）", 1, 4, "2030/12/17 14:59:59", 0.0, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24016, 24, 4.0, 0.0, "カオリ（サマー）", 2, 4, "2030/12/17 14:59:59", 0.0, 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24017, 24, 0.0, 0.0, "カオリ（サマー）", 3, 4, "2030/12/17 14:59:59", 0.0, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24018, 24, 5.2, 0.0, "カオリ（サマー）", 4, 1, "2030/12/17 14:59:59", 0.0, 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24019, 24, 4.2, 0.0, "カオリ（サマー）", 5, 5, "2030/12/17 14:59:59", 0.0, 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24020, 24, 0.0, 0.0, "カオリ（サマー）", 6, 2, "2030/12/17 14:59:59", 0.0, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24021, 24, 6.4, 0.0, "カオリ（サマー）", 7, 1, "2030/12/17 14:59:59", 0.0, 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24022, 24, 0.0, 0.0, "カオリ（サマー）", 8, 2, "2030/12/17 14:59:59", 0.0, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24023, 24, 10.08, 0.0, "カオリ（サマー）", 9, 6, "2030/12/17 14:59:59", 0.0, 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24024, 24, 5.0, 0.0, "カオリ（サマー）", 10, 1, "2030/12/17 14:59:59", 0.0, 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 110501, "2019/07/31 12:00:00");
INSERT INTO `v1_08fd7903dabacc0e1339ba4fa6cbb1a1a431cc72f0bdccd384751c18cb53e55b` VALUES (10021, 24025, 24, 0.0, 0.0, "カオリ（サマー）", 11, 2, "2030/12/17 14:59:59", 0.0, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 110501, "2019/07/31 12:00:00");
